import axios from "axios";
import React from "react";

const baseURL_ADD = "http://localhost:9090/ssd";
const baseURL_LIST = "http://localhost:9090/ssd/list";


export default function SsdService(){

const [ssd, setSsd]= React.useState(null);

React.useEffect(() => {
    axios.get("${baseURL_LIST}").then((response) => {
      setSsd(response.data);
    });
},[]);

function addSsd(){
    axios
      .post(baseURL_ADD, {
        brand: "",
        model: "",
        serialNumber: "",
        size: "",
        purcaseDate: "",
        purchasePrice: "",
        arrivalDate: "",
      })
      .then((response) => {
        setSsd(response.data);
      });
}
if(!ssd) return "No post, erro."

return(
     <div>
      <h1>{ssd.brand}</h1>
      <p>{ssd.model}</p>
      <button onClick={addSsd}>Create Post</button>
    </div>
);
}
